import GnG from './components/GnG';
import Home from './components/Home';
import Navbar from './components/Navbar';
import { BrowserRouter, Route, Router, Routes } from 'react-router-dom'
import VRC from './components/VRC';
import DR from './components/DR';
import SPIC from './components/SPIC';




function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Navbar />}>
          <Route index element={<Home />}>
            <Route index element={<GnG />} />
            <Route path="/vrc" element={<VRC />} />
            <Route path="/dr" element={<DR />} />
            <Route path="/spic" element={<SPIC />} />
          </Route>

        </Route>
      </Routes>
    </BrowserRouter>

    // <Routes>
    //   <Route path="/" element={<Home />} />  
    //   <Route path="/vendors" element={<Vendors />} />
    //   <Route path="/assets" element={<Assets />} />
    //   <Route path="/spares" element={<Spares />} />
    //   <Route path="/amc" element={<AMC />} />
    //   <Route path="/admin" element={<Admin />} />
    //   <Route path="/login" element={<Login />} />

    //   {/* Nested routes within Home */}
    // </Routes>

  );
}

export default App;
